import React from 'react';
import { YAxis as RechartsYAxis } from 'recharts';

const YAxisWrapper = ({ label }) => {
  const { value, angle, position } = label; // Dobijamo vrednost, ugao i poziciju iz label objekta
  return <RechartsYAxis label={{ value, angle, position }} />;
};

export default YAxisWrapper;
